package src.digitalBookstore;import java.util.Collection;import java.util.HashMap;import java.util.Map;import java.util.Set;public class MyMaps extends Users{    public static HashMap<Integer, Object> users = new HashMap<Integer, Object>();    public MyMaps(String name, int dateofBirth, int phone) {        super(name, dateofBirth, phone);    }    public static void main(String[] args) {        users.put(100, user1);        users.put(300, user2);        users.put(200,user3 );        users.put(50, user4);        System.out.println(users.toString());        Set<Integer> keySet = users.keySet();        Collection<Object> valuesSet = users.values();        Set<Map.Entry<Integer, Object>> entrySet = users.entrySet();        System.out.println( user1.equals(user2));        setUsers(700,"Bartosz Orzechowski");        System.out.println(users.get(100));        System.out.println("Klucze  to: \n" + keySet.toString() + " ; \n" +                " Użytkownicy to: \n " + valuesSet.toString());        for (Map.Entry<Integer, Object> entry : entrySet) {            System.out.println("Klucz  nr: " + entry.getKey().toString() + " : " + "Użytkownik : " + entry.getValue().toString());        }    }static int number;    static String name;    private static void setUsers(int number, String name) {        users.put(number, name);    }}